syntax = "proto3";
package proto;
import "Request.proto";
import "Response.proto";
import "Global.proto";

option java_package = "net.iGap.proto";
option java_outer_classname = "ProtoAesEncryptedKey";

message AesEncryptedKey {
    Request request = 1;
    string aes_key = 2;
}

message AesEncryptedKeyResponse {
    Response response = 1;
    bool ok = 2;
}
